import "./App.css";
import Carousel from 'react-multi-carousel';
import 'react-multi-carousel/lib/styles.css';

function App() {
  const responsive = {
    superLargeDesktop: {
      // the naming can be any, depends on you.
      breakpoint: { max: 4000, min: 3000 },
      items: 5
    },
    desktop: {
      breakpoint: { max: 3000, min: 1024 },
      items: 3
    },
    tablet: {
      breakpoint: { max: 1024, min: 464 },
      items: 2
    },
    mobile: {
      breakpoint: { max: 464, min: 0 },
      items: 1
    }
  };


  return (
    <div className="App">
      <Carousel responsive={responsive}>
        <div className='card'>
          <img src='https://m.media-amazon.com/images/I/51iQq6ZYedL.jpg' alt='Product Image' className="product--image"></img>
          <h2>Don Quixote</h2>
          <p className='price'>$11.99</p>
          <p>Some Description</p>
          <p>
            <button>Buy now</button>
          </p>

        </div>
        <div>Item 2</div>
        <div>Item 3</div>
        <div>Item 4</div>
      </Carousel>;
    </div>
  );
}

export default App;
